import React from 'react'
import { 
  Box, 
  Stack, 
  styled, 
  
} from '@mui/material'

import imgMen from '../assets/men.png';




const Information = () => {

    const StackColumn = styled(Stack) (() => ({
      flexDirection: 'column',
      justifyContent: 'flex-start',
      alignItems: 'center',
      flex: 1,
      gap: 8,
      textAlign: 'center',
    }));
  
    const BoxRow = styled(Box) (({ theme }) => ({
      display: 'flex',
      flexDirection: 'row',
      backgroundColor: '#000544',
      flex: 1,
      [theme.breakpoints.down('sm')]: {
        flexDirection: 'column',
        gap: 30,
      }
    }));

    const imgStyle = {
      width: '40%', 
      height: 'auto', 
      paddingBottom: '0px',
      paddingLeft: '900px'
      
    };
   
  
    return (
      
      <BoxRow 
      component = 'insormation'
      sx={{
        py: 4,
        px: 2,
      }}
      >
        <StackColumn>
        <head>
    <link rel="stylesheet" type="text/css" href="styles.css"/>
</head>
<body>
    <div class="container">
        <img src={imgMen} alt="Homem Apontando" class="imagem-direita" style={imgStyle} />
    </div>
</body>
        </StackColumn>
      </BoxRow>
    )
  }

  export default Information
